import React, {FC} from "react";
import {AccordionComponent} from "./accordion_component/AccordionComponent";
import {Auto_icon} from '@src/components/elements/icons';

type AncmntAutoFormProps = {
    autoData: {
        manufacturer,
        models,
        body,
        transmission,
        drive,
    }
};

export const AncmntAutoForm: FC<AncmntAutoFormProps> = (props) => {
    const {autoData} = props;

    return (
        <div>
            <AccordionComponent
                icon={Auto_icon}
                title='Автомобиль'
            />
        </div>
    )
};
